import React, { Component } from "react";

class Modal extends Component {
  constructor(props) {
    super();
    this.state = {
      memberInfo: props
    };
    console.log(props);
  }

  render() {
    const { nickName, enrolledIn, cell } = this.state;

    return (
      <div className="modal">
        <div className="background">
          <div className="card">
            <span className="cancel"></span>
            <div className="row">
              <div className="key">닉네임</div>
              <input value={nickName} className="value" />
            </div>
            <div className="row">
              <div className="key">소속</div>
              <input value={cell} className="value" />
            </div>
            <div className="row">
              <div className="key">입사일</div>
              <input value={enrolledIn} className="value" />
            </div>
            <div className="button-wrapper">
              <button className="change">수정하기</button>
              <button className="delete">삭제하기</button>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Modal;
